export default (props) =>(
      <div className='beerCard'>
            <img src={props.image_url} className='beerPhotos' alt ='photo' />
            <h2 className='beer-name'>{props.name}</h2>
            <p>{props.tagline}</p>
            <p><bolt>First brewed:</bolt> {props.first_brewed}</p>
            <p>{props.description}</p>
            <p>Abv: {props.abv}</p>
            <p>Attenuation level: {props.attenuation_level}</p>
            <p>Brewers tips: {props.brewers_tips}</p>
            <p>Contributed by: {props.contributed_by}</p>
            <p>Ebc: {props.ebc}</p>
            <p>Ibu: {props.ibu}</p>
            <p>Ph: {props.ph}</p>
            <p>Srm: {props.srm}</p>
            <p>Target FG: {props.target_fg}</p>
            <p>Target OG: {props.target_og}</p>
            <p>Volume: {props.volume.value} {props.volume.unit} </p>
            <p>Boil volume: {props.boil_volume.value} {props.boil_volume.unit}</p>
            <h3>Ingredients:</h3>
            <h4>Hops</h4>
            {props.ingredients.hops.map( (elem,index) => {
                  return(
                        <p key = {'hops'+index}>{elem.name}: {elem.amount.value} {elem.amount.unit}</p>
                  )
            })}
            <h4>Malt</h4>
            {props.ingredients.malt.map( (elem,index) => {
                  return(
                        <p key = {'malt'+index}>{elem.name}: {elem.amount.value} {elem.amount.unit}</p>
                  )
            })}
      </div>
)
